import React from "react";
import { Router, Switch, Route } from 'react-router-dom';
import { connect } from "react-redux";

import history from "./history";

import "./App.css";

import ChargerMapPage from './pages/ChargerMapPage';
import ChargerPage from './pages/ChargerPage';
import LoginPage from './pages/LoginPage';
import RegistrationPage from './pages/RegistrationPage';
import VerifyEmailPage from './pages/VerifyEmailPage';

import Header from './components/Header.js'
import PrivateRoute from "./components/PrivateRoute";
import RegisterChargerMapPage from "./pages/RegisterChargerMapPage";
import RegisterChargerPage from "./pages/RegisterChargerPage";

/**
 *
 * Applikasjon med ruting til sider.
 * @param props - inneholder state
 * @component
 * @author Magnus, Sven & Håkon
 */

const App = (props) => {
    console.log(props.state);
    return (
        <Router history={history}>
            <div className="app">
                <Header />
                <div className="scope">
                    <Switch>
                        <PrivateRoute path="/" exact component={ChargerMapPage} />
                        <PrivateRoute path="/charger/:id" component={ChargerPage} />
                        <PrivateRoute path="/registerchargermap" component={RegisterChargerMapPage} />
                        <PrivateRoute path="/registercharger/:lat/:lng/:address" component={RegisterChargerPage}/>
                        <Route path="/registration" component={RegistrationPage} />
                        <Route path="/verifyemail" component={VerifyEmailPage} />
                        <Route path="/login" component={LoginPage} />
                    </Switch>
                </div>
            </div>
        </Router>
    );
}

const mapStateToProps = (state) => {
    return {
        state: state
    }
}

export default connect(mapStateToProps)(App);
